script: |
  super -f text -I q1705.spq | sort > q1705.out

inputs:
  - name: q1705.spq
    data: |
      SELECT DISTINCT col2 * + + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + + 47 NOT IN ( + col0 + col0, + 36, - + col1 / + - col2 * + col1 + - ( - 39 ) );
  - name: tab0

outputs:
  - name: q1705.out
    data: |
